import React from 'react';

function App() {
  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      fontSize: '80px',
      fontFamily: '"Uncial Antiqua", cursive',
      backgroundColor: '#faf8f3',
      color: '#2d2a26'
    }}>
      hello world
    </div>
  );
}

export default App;
